import React from 'react';
import CompleteProgress from './Home/CompleteProgress';

const lists = ['Legends Arceus', 'Brilliant Diamond', 'Shield', 'Let\'s go Pikachu', 'Ultra Sun', 'Moon', 'Alpha Sapphire', 'X', 'Black 2', 'White', 'Heart Gold', 'Pearl', 'Emerald', 'Fire Red', 'Crystal', 'Red']
function Home() {
  return(
    <div className='Home'>
      <h1>PokeTrack</h1>
      <div id="games">
        {
          lists.map((game) => <CompleteProgress game={game}/>)
        }
      </div>
    </div>
  );
}

export default Home;
